import { DateTime } from 'luxon';
import React from 'react';
import IChat from '../alias/IChat';

interface IChatListDates{
    chat: IChat;
}

const ChatListDates: React.FC<IChatListDates> = (chat) => {
    return(
        <div>
            {chat.chat.messages && chat.chat.messages.length > 0
                ? chat.chat.messages[chat.chat.messages.length - 1].time === "" ||
                  chat.chat.messages[chat.chat.messages.length - 1].time === "—:—"
                  ? "—:—"
                  : chat.chat.messages[chat.chat.messages.length - 1].time !==
                      ("" && "—:—") &&
                    DateTime.fromISO(
                      chat.chat.messages[chat.chat.messages.length - 1].time
                    ).day === DateTime.local().day
                  ? DateTime.fromISO(
                      chat.chat.messages[chat.chat.messages.length - 1].time
                    ).toLocaleString(DateTime.TIME_SIMPLE)
                  : DateTime.fromISO(
                      chat.chat.messages[chat.chat.messages.length - 1].time
                    ).toLocaleString(DateTime.DATETIME_SHORT)
            : null}
        </div>
    );
}

export default ChatListDates;
